import * as React from 'react';
import { DataGrid } from '@material-ui/data-grid';

function getFullName(params) {
  return `${params.getValue('firstName') || ''} ${
    params.getValue('lastName') || ''
  }`;
}

const columns = [
  { field: 'firstName', headerName: 'First name', width: 130 },
  { field: 'lastName', headerName: 'Last name', width: 130 },
  {
    field: 'fullName',
    headerName: 'Full name',
    width: 160,
    valueGetter: getFullName,
    sortComparator: (v1, v2, cellParams1, cellParams2) =>
      getFullName(cellParams1).localeCompare(getFullName(cellParams2)),
  },
];

const rows = [
    {
        "form_number": 13,
        "port": "bababa",
        "primary_owner": "sosuri@ucsc.edu",
        "proposed_ship_name": "testing999",
        "registration_date": "Mon, 30 Nov 2020 00:00:00 GMT",
        "ship_lenght": "111.",
        "ship_type": "testing999"
    }
]

export default function ValueGetterGrid() {
  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid rows={rows} columns={columns} />
    </div>
  );
}
